import * as vscode from 'vscode';
const debug = true;
/**
 * Provider that maintains a count of the number of times it has copied text.
 */
class CopyPasteEditProvider implements vscode.DocumentPasteEditProvider {

	async provideDocumentPasteEdits(
		_document: vscode.TextDocument,
		_ranges: readonly vscode.Range[],
		_dataTransfer: vscode.DataTransfer,
		_token: vscode.CancellationToken
	): Promise<vscode.DocumentPasteEdit | undefined> {
		if (debug) {
			console.log('paste code');
		}
		const snippet = new vscode.SnippetString();
		snippet.appendText('woah');
		console.log(snippet);
		return { insertText: snippet };
	}
}

export function imagePasteSetup(context: vscode.ExtensionContext) {
	if (debug) {
		initAttachmentCommand(context);
	}

	const selector: vscode.DocumentSelector = { notebookType: 'jupyter-notebook' };

	// Register our provider
	context.subscriptions.push(vscode.languages.registerDocumentPasteEditProvider(selector, new CopyPasteEditProvider(), {
		pasteMimeTypes: ['text/plain', 'image/png'],
	}));

}

function initAttachmentCommand(context: vscode.ExtensionContext) {
	const disposable = vscode.commands.registerCommand('ipynb.replaceAttachmentWithMrBase', () => {
		const notebookUri = vscode.window.activeNotebookEditor?.notebook.uri;
		const edit = new vscode.WorkspaceEdit();
		const Mr_Base = '';
		// const cellMetadataEdit = vscode.NotebookEdit.insertCells(0, []);
		// const cellMetadataEdit = vscode.NotebookEdit.updateCellMetadata(0, {'custom' : { 'attachments' : { 'image.png' : { 'image/png' : ''}}}});
		const cellMetadataEdit = vscode.NotebookEdit.updateCellMetadata(0, { 'custom': { 'attachments': { 'image.png': { 'image/png': Mr_Base } } } });
		if (notebookUri) {
			edit.set(notebookUri, [cellMetadataEdit]);
		}
		vscode.workspace.applyEdit(edit);
		vscode.window.showInformationMessage('metadata update complete');
	});

	context.subscriptions.push(disposable);
}
